import './App.css';
import './bounce.css';
import React from 'react';
import Typewriter from "typewriter-effect";
import $ from 'jquery'

function App() {
  var app = document.getElementById('aboutMe');

  var typewriter = new Typewriter(app, {
    loop: true,
    delay: 75,
  });
  
  typewriter
    .pauseFor(2500)
    .typeString('A simple yet powerful native javascript')
    .pauseFor(300)
    .deleteChars(10)
    .typeString('<strong>JS</strong> plugin for a cool typewriter effect and ')
    .typeString('<strong>only <span style="color: #27ae60;">5kb</span> Gzipped!</strong>')
    .pauseFor(1000)
    .start();
  return (
  <>
  

  <div id='intro'>
    <div id='name'>
      <div className="bouncing-text">
        <div className="b">h</div>
        <div className="o">i</div>
        <div className="u">,</div>
      </div>
      <div className="bouncing-text">
        <div className="b">i</div>
        <div className="o">'</div>
        <div className="u">m</div>
        <div className="n">N</div>
        <div className="c">a</div>
        <div className="e">v</div>
        <div className="f">i</div>
        <div className="g">d</div>
      </div>
    </div>
  </div>
 
  
  <div  id='aboutMe'></div>
  </>
  );
  
}

